import TailwindTest from "./TailwindTest";
import { Accordion, AccordionItem, AccordionTrigger, AccordionContent } from "./components/Accordion";
import { Button, Card } from "./components/ShadcnDemo";

function App() {
  return (
    <div>
      <TailwindTest />
      <div className="max-w-md mx-auto mt-10 space-y-6">
        <Card>
          <h2 className="text-xl font-bold mb-2">ShadCN New York Theme Card</h2>
          <p className="mb-4 text-foreground">This card uses the New York theme colors and border radius.</p>
          <Button>ShadCN Button</Button>
        </Card>
      </div>
    </div>
  );
}

export default App;
